INSERT INTO `lari` (`id`, `arti`, `tips_laripagi`, `manfaat_laripagi`, `gambar`) VALUES
(1, 'Lari pagi adalah olahraga yang baik dan juga cara yang bagus\r\nuntuk mengawali hari.\r\nUntuk memulai lari pagi, Anda harus menyiapkan pakaian yang tepat,\r\nmakan makanan yang tepat, dan memiliki niat untuk menjadikan \r\nkegiatan ini salah satu rutinitas Anda.', '1. Siapkan pakaian yang tepat.\r\n\r\nJika Anda ingin lari atau jalan pagi, maka Anda harus memiliki \r\npakaian yang tepat. Meskipun lari dan jalan pagi merupakan \r\nolahraga yang ringan, memakai pakaian dan sepatu yang tepat \r\nakan membuat Anda merasa nyaman dan bersemangat ketika lari pagi.\r\nMisalkan: sepatu, kaos yang ringan berbahan non-kapas.', '1. Suasana yang Lebih Nyaman\r\n2. Meningkatkan Energi dan Stamina\r\n3. Membantu Menurunkan Berat Badan\r\n4. Menjaga Kesehatan Otot Kaki\r\n5. Menurunkan Tekanan Darah Tinggi\r\n6. Kualitas Tidur Lebih Baik\r\n7. Menjaga Kesehatan Jantung\r\n8. Sistem Pernapasan Sehat\r\n9. Meningkatkan Daya Tahan Tubuh\r\n10. Mencegah Impotensi', ),
(2, '', '2. Siapkan Waktu yang tepat.\r\n\r\nHal terpenting yang perlu Anda miliki untuk lari pagi tentunya \r\nwaktu yang cukup untuk melakukannya. Tentukan durasi Anda sendiri; \r\n30 menit adalah durasi yang cukup untuk jalan, sedangkan untuk lari, \r\nAnda harusnya cukup dengan 20 menit jika Anda masih pemula. \r\nJangan lupa untuk menyisakan cukup waktu setelah olahraga \r\nuntuk pendinginan, makan, mandi, dan semua persiapan yang \r\nAnda perlukan untuk menjalani aktivitas lain.', '', );
INSERT INTO `lari` (`id`, `arti`, `tips_laripagi`, `manfaat_laripagi`, `gambar`) VALUES
(3, '', '3. Rencanakan rute Anda.\r\n\r\nJika Anda hanya ingin lari atau jalan di sekitar lingkungan rumah \r\nsampai merasa capek, Anda tidak perlu terlalu merencanakan rute. \r\nTapi jika Anda ingin mencapai target tertentu untuk jarak lari Anda, \r\nmaka siapkanlah rutenya terlebih dahulu menggunakan aplikasi \r\natau website seperti Gmaps Pedometer.', '', ),
(4, '', '4. Keluar dan lari pagi.\r\n\r\nSetelah Anda sudah mengenakan pakaian olahraga dan barang lainya. \r\nSekarang, Anda siap untuk keluar dan memulai hari. Larilah sesuai \r\ndengan keinginan atau rencana Anda dan nikmati olahraga pagi Anda. \r\nJika Anda sudah menyiapkan rutenya, ikutilah rute tersebut. Jika tidak, \r\nnikmati saja apa yang bisa Anda lihat dan temui sambil lari pagi.', '', );
INSERT INTO `lari` (`id`, `arti`, `tips_laripagi`, `manfaat_laripagi`, `gambar`) VALUES
(5, '', '5. Manfaatkan waktu Anda sebaik-baiknya.\r\n\r\nJika lari pagi merupakan satu-satunya momen Anda untuk olahraga, \r\njangan bermain-main! Manfaatkan sebaik-baiknya. Selain itu, \r\njika Anda lari pagi sendirian dan jarang mendapat waktu untuk sendiri, \r\nmanfaatkan juga momen ini untuk menenangkan diri dan memikirkan \r\nhal yang jarang Anda pikirkan jika tidak sendirian.', '', ),
(6, '', '6. Pendinginan. \r\n\r\nSetelah selesai lari, jalanlah selama beberapa menit untuk pendinginan. \r\nJika Anda memang jalan sejak awal, berdirilah selama satu atau dua menit. \r\nBiarkan suhu tubuh, nafas, dan detak jantung Anda kembali normal \r\nsebelum melakukan hal lain seperti makan atau mandi.', '', );
INSERT INTO `lari` (`id`, `arti`, `tips_laripagi`, `manfaat_laripagi`, `gambar`) VALUES
(7, '', '7. Peregangan. \r\n\r\nLakukan peregangan setelah Anda lari atau jalan untuk melemaskan \r\nbadan dan mencegah cedera. Tidak usah melakukan peregangan yang sulit, \r\ncukup yang sederhana dan mudah dilakukan saja seperti bungkuk \r\nmenyentuh jempol kaki, meregangkan otot paha, atau memutar kepala & bahu. \r\nAnda juga bisa melakukan beberapa gerakan lain dalam posisi duduk.', '', );

